  Oliver b. at London, England. Susan b. at Bridgeport, Connecticut, USA. Address: 18 Cook Terrace,
  Mona Vale 2103, Sydney NSW, Australia.
  Oliver was educated at King Edward VI School in Norwich then attended university at King's College,
  London, graduating with an honours degree in civil engineering. Since then he has worked
  extensively in both England and Australia and he also spent 18 months working on a rural
