  Address: Riverbank, Whitlingham Lane, Trowse, Norwich NR14 8TW, England.
  Simon is an architect. After qualifying at the Architectural Association in London in 1955, Simon
  worked for Sir Hugh Casson in London. He moved to Norwich in 1962 and built himself a house in the
  Cathedral Close, and in 1965 he joined Feilden + Mawson, becoming a Partner a year later. He ran the
  London office of Feilden + Mawson from 1978 to 1990.
  Between 1952 and 1962 Simon was very active in rowing, winning four events at the Henley Royal Regatta
  and representing Great Britain in the European Championships in 1957, 1958 and 1959. He won a Gold
  Medal and achieved a world record in a coxed 4 at the Commonwealth and Empire Games in Wales in 1958
  and carried on to represent Great Britain in a coxed 4 in the 1960 Olympics.
  03> WILLIAMS, Philip Leslie Bruce m on 08.05.1929 to (1) PURCHAS, Esme Guyon
