  Philip b. at Te Aute and educated at Huntley School and Wanganui Collegiate School. He graduated BE at the
  University of Canterbury and won a GEC graduate fellowship to the USA. He was a long term employee of Lever
  Bros as chief engineer in Wellington and was design engineer with Dominion Breweries in Auckland.
  His interests included gardening, writing poetry, hand-made jewellery and harmony singing with a group of
  long-standing friends. In his retirement he was involved in researching and writing on historical matters
  of both the Maori race and the Williams family. He had several articles published by historical societies.
